import {useState, useEffect} from 'react';
import React, {Component} from 'react';
import "./App.css"

class App extends Component {
    constructor(props) {
      super(props);
      this.state = {
          loggedIn: false
      }
    }
    async componentDidMount() {
      console.log('mounted');
      try {
        console.log('in');
        let response = await fetch("http://localhost:3300/manager/employee-list");
        console.log(response)
      }
      catch(e) {
        alert("Server is not running.");
      }
    }
    render () {
      return (
        <div>
          <h1>Log-In</h1>
        </div>
      );
    }
}

export default App;
